import React from 'react';
import {Link} from 'react-router-dom';

const Nav = ({dogs}) => {


    return (
        <div>
            <Link to="/dogs">
                Home
            </Link>
            {dogs.map(data => (
                <Link to={`dogs/${data.name}`}>
                    {data.name}
                </Link>
            ))}
        </div>
    )
}

export default Nav;
